pragma solidity ^0.5.11;
import "../../eternal-storage/EternalStorageInterface.sol";

/// @title All Signature Document
/// @notice This contract stores the document's hash and signatories, all signatures are required to be considered valid
contract AllSignature {
  /// @notice struct for storing all information of document.
  /// @param documentHash Hashing of document done on front end. Must be hashed to 256 bits or 32 bytes.
  /// @param fileName File description/name.
  /// @param uploader Address of account that created smart contract. Obtained through contract constructor.
  /// @param date Unix timestamp of the time when smart contract was constructed.
  /// @param signaturesNeeded amount of signatures required for valid document. Equals number of valid signatories.
  /// @param signedCount Number of signatures obtained.
  /// @param contractType Type of signature smart contract. Allsignature is assigned: 1.
  struct docInfo_ {
    bytes32 documentHash;
    string fileName;
    address uploader;
    uint256 date;
    uint256 signaturesNeeded;
    uint256 signedCount;
    uint256 contractType;
  }

  /// @notice struct containing individual information of each signatory.
  /// @param signersEmail Hash of signers email to 256 bits/32 bytes. Obtained through contract constructor.
  /// @param signature Signature obtained through metamask.
  /// @param exists Exists defaults to false if address isn't valid. Used to ensure validity of address.
  struct signersInfo {
    bytes32 signersEmail;
    string signature;
    bool exists;
  }

  address[] signersAddresses;
  EternalStorageInterface es;
  docInfo_ docInfo;
  mapping(address => signersInfo) public signersMap;

  /// @notice contract constructor. Called only by the All signature factory. Params are self explanatory.
  /// @param _uploader Address of creator of All Signature Contract.
  /// @param _eternalStorage Address of eternal storage for metric logging.
  /// @param _documentHash Hash of uploaded document within 32 bytes.
  /// @param _signersAddresses Array of addresses. Ensure index of address corresponds to index of signersEmails
  /// @param _signersEmails Array of 32 bytes hash of emails of signatories.
  /// @param _date Unix timestamp of when the contract is created
  /// @param  _fileName Description/Name of file.
  constructor(
    address _uploader,
    address _eternalStorage,
    bytes32 _documentHash,
    address[] memory _signersAddresses,
    bytes32[] memory _signersEmails,
    uint256 _date,
    string memory _fileName
  ) public {

    es = EternalStorageInterface(_eternalStorage);
    signersAddresses = _signersAddresses;

    docInfo.uploader = _uploader;
    docInfo.documentHash = _documentHash;
    docInfo.fileName = _fileName;
    docInfo.date = _date;
    docInfo.signaturesNeeded = _signersAddresses.length;
    docInfo.contractType = 1;

    for (uint256 i = 0; i < signersAddresses.length; ++i) {
      signersMap[signersAddresses[i]].signersEmail = _signersEmails[i];
      signersMap[signersAddresses[i]].exists = true;
    }
  }

  modifier isValidSigner(address _address) {
    require(signersMap[_address].exists == true, "Must be a valid signatory");
    _;
  }

  modifier notYetSigned(address _address) {
    require(bytes(signersMap[_address].signature).length == 0, "Signatory has signed");
    _;
  }

  /// @notice event emitted upon the block confirmation of the signing of document.
  event SigningEvent(
    address indexed _from,
    address indexed _this,
    bytes32 _dochash,
    uint256 _type,
    bool _signed
  );

  /// @notice Store signature in contract
  /// @dev Invoked by signatory, only possible if signer is a valid signatory.
  /// @param _signature signed hash of the document. Type: String.
  /// @param _dochash hash of document to 32 bytes.
  /// @return boolean value if signing was successful + emit event.
  function signDocument(string calldata _signature, bytes32 _dochash)
    external
    isValidSigner(msg.sender)
    notYetSigned(msg.sender)
    returns (bool)
  {
    require(
      keccak256(abi.encodePacked((docInfo.documentHash))) ==
        keccak256(abi.encodePacked((_dochash))),
      "Incorrect document hash"
    );
    signersMap[msg.sender].signature = _signature;
    docInfo.signedCount++;
    emit SigningEvent(msg.sender, address(this), _dochash, 1, true);
    es.incrementMetrics("ALLSIG_SIGNATURES_COUNT");

    return true;
  }

  /// @notice Get signers' addresses
  /// @dev Invoked by anyone
  /// @return array of signers' addresses
  function getSignersAddresses() external view returns (address[] memory) {
    return signersAddresses;
  }

  /// @notice Check if document is signed by all signatories
  /// @dev Invoked by anyone, inherited by multisig
  /// @return boolean value
  function isDocumentValid() public view returns (bool) {
    if (docInfo.signedCount >= docInfo.signaturesNeeded) {
      return true;
    }
    return false;
  }

  /// @notice returns all information of individual account if exists within mapping.
  /// @param _address Address of the account who's information you want to get.
  /// @return signer's email, signature, and whether it currently exists.
  function getSignerInfo(address _address)
    external
    view
    returns (bytes32, string memory, bool)
  {
    return (
      signersMap[_address].signersEmail,
      signersMap[_address].signature,
      signersMap[_address].exists
    );
  }

  /// @notice returns all information current document.
  function getDocInfo()
    external
    view
    returns (bytes32, string memory, address, uint256, uint256, uint256, uint256)
  {
    return (
      docInfo.documentHash,
      docInfo.fileName,
      docInfo.uploader,
      docInfo.date,
      docInfo.signaturesNeeded,
      docInfo.signedCount,
      docInfo.contractType
    );
  }
}

